xterm_loop=
nox11=n
copy=none
ownership=y
verbose=n

initargs="$@"

while true
do
    case "$1" in
    -h | --help)
	MS_Help
	exit 0
	;;
    --info)
	echo Identification: "$label"
	echo Target directory: "$targetdir"
	echo Uncompressed size: 476 KB
	echo Compression: gzip
	echo Date of packaging: Tue Jan 23 17:56:09 IST 2024
	echo Built with Makeself version 2.1.5 on darwin21
