if test "$targetdir" = "."; then
    tmpdir="."
else
    dashp="-p"
    if test "$keep" = y; then
	echo "Creating directory $targetdir" >&2
	tmpdir="$targetdir"
	keep=n
    else
	tmpdir="$TMPROOT/selfgz$$$RANDOM"
    fi
    df -kP $tmpdir >/dev/null 2>&1
    if test "$?" = 0; then
        tmpfs=`df -kP $tmpdir | grep "%" | awk '{print $NF}'`
        mount | grep " $tmpfs " | grep noexec >/dev/null 2>&1
        if test "$?" = 0; then
	    echo "$tmpfs is a noexec file system" >&2
	    echo 'You should try option --target OtherDirectory' >&2
	    eval $finish
	    exit 1
        fi
    fi
    mkdir $dashp $tmpdir || {
	echo 'Cannot create target directory' $tmpdir >&2
	echo 'You should try option --target OtherDirectory' >&2
	eval $finish
	exit 1
    }
    df -kP $tmpdir >/dev/null 2>&1
    if test "$?" = 0; then
        tmpfs=`df -kP $tmpdir | grep "%" | awk '{print $NF}'`
        mount | grep " $tmpfs " | grep noexec >/dev/null 2>&1
        if test "$?" = 0; then
	    /bin/rm -rf $tmpdir >/dev/null 2>&1
	    echo "$tmpfs is a noexec file system" >&2
	    echo 'You should try option --target OtherDirectory' >&2
	    eval $finish
	    exit 1
        fi
    fi
fi

location="`pwd`"
if test x$SETUP_NOCHECK != x1; then
    MS_Check "$0"
fi
offset=`head -n 461 "$0" | wc -c | tr -d " "`

if test x"$verbose" = xy; then
	MS_Printf "About to extract 476 KB in $tmpdir ... Proceed ? [Y/n] "
	read yn
	if test x"$yn" = xn; then
		eval $finish; exit 1
	fi
fi

MS_Printf "Uncompressing $label"
type gzip >/dev/null 2>&1
if test "$?" != 0; then
    _Which_gzip_ gzip GZIP
    if test -n $GZIP; then
        PATH="$PATH:`dirname $GZIP`"
    else
        PATH="$PATH:/usr/local/bin"
    fi
    export PATH
    type gzip >/dev/null 2>&1
    if test "$?" != 0; then
        echo 'You should install gzip on your system before installing this package' >&2
        eval $finish
        exit 1
    fi
fi
res=3
if test "$keep" = n; then
    trap 'echo Signal caught, cleaning up >&2; cd $TMPROOT; /bin/rm -rf $tmpdir; eval $finish; exit 15' 1 2 3 15
fi

leftspace=`MS_diskspace $tmpdir`
if test $leftspace -lt 476; then
    echo
    echo "Not enough space left in "`dirname $tmpdir`" ($leftspace KB) to decompress $0 (476 KB)" >&2
    if test "$keep" = n; then
        echo "Consider setting TMPDIR to a directory with more free space."
   fi
    eval $finish; exit 1
fi

for s in $filesizes
do
    if MS_dd "$0" $offset $s | eval "gzip -cd" | ( cd "$tmpdir"; UnTAR x ) | MS_Progress; then
		if test x"$ownership" = xy; then
			(PATH=/usr/xpg4/bin:$PATH; cd "$tmpdir"; chown -R `id -u` .;  chgrp -R `id -g` .)
		fi
    else
		echo
		echo "Unable to decompress $0" >&2
		eval $finish; exit 1
    fi
    offset=`expr $offset + $s`
done
echo

cd "$tmpdir"
res=0
if test x"$script" != x; then
    if test x"$verbose" = xy; then
		MS_Printf "OK to execute: $script $scriptargs $* ? [Y/n] "
		read yn
		if test x"$yn" = x -o x"$yn" = xy -o x"$yn" = xY; then
			eval $script $scriptargs $*; res=$?;
		fi
    else
		eval $script $scriptargs $*; res=$?
    fi
    if test $res -ne 0; then
		test x"$verbose" = xy && echo "The program '$script' returned an error code ($res)" >&2
    fi
fi
if test "$keep" = n; then
    cd $TMPROOT
    mount | grep " $tmpdir " >/dev/null 2>&1
    if test "$?" != 0; then
        /bin/rm -rf $tmpdir >/dev/null 2>&1
    fi
fi
eval $finish; exit $res
